declare
    lPERSONNELTYPECATEGORY_ID   number;
begin
    for data in (select * from samplepersonneltypes)
    loop
        begin
            select id into lPERSONNELTYPECATEGORY_ID from 
            personneltypecategory ptc 
            where upper(ptc.name)=upper(trim(data.Position_Type_Category));
            
            exception
                when no_data_found then
                    lPERSONNELTYPECATEGORY_ID := 0;
        end;
    
    
        if lPERSONNELTYPECATEGORY_ID > 0 then
            INSERT INTO PersonnelType
                (ID, CODE, TYPE, RATE, AVERAGEPAY, SERVICE_ID, ACTIVE, 
                    SORTORDER, SHOWSALES,PERSONNELTYPECATEGORY_ID)
            values
                (PersonnelType_pk_seq.nextval, trim(data.Short_Code), trim(data.Position_Type_Name), data.RATE,  data.Average_Pay, 2,  1, 
                    data.Sort_Order, 1,lPERSONNELTYPECATEGORY_ID);
        end if;
    end loop;
    Commit;
end;
/

