set define off;
set SERVEROUTPUT ON;
declare
	laddressid  number;
	leffid      number;
	lrate       number;
    lSSNValue   number;
    lSSN        varchar2(1000);
    lResourceId number;
    lAvailability varchar2(1000);
    lPTAEFFECTIVEDATESId  number;
    lAvailabilityStart  varchar2(10) default '06/01/2019';
    lPersTypeStart      varchar2(10) default '06/01/2019';
begin
    lAvailability := '';
    for data in(select * from SAMPLEWORKER)
    loop

        insert into address(id,workphone,cell,workfax,email,street,suite,city,state,zip) 
        values(address_pk_seq.nextval,data.phone,data.mobile,data.fax,trim(data.email),
        trim(data.street),trim(data.suite),trim(data.city),
        (select id from state where lower(code)= lower(data.Statename)),
        data.zip) 
        returning id into laddressid;
        
        insert into resources(id,fname,MI,lname,active,
          ssn,hiredate,
          workertype_id,
          sortorder, address_id,sex,
