 declare
    lStartDate  date;
    lCopyDate   date;
    lAid        workeravailability.id%type;
    lEndDate    date;
    lRetValue   number;
begin
    for data in (
        select * from availabilitymain 
        where enddate > trunc(sysdate) order  by resource_id, enddate)
    loop
        lCopyDate := Availabilityapi.GETCOPYDATE(data.enddate,trunc(Sysdate));
        lStartDate := next_day(trunc(data.startdate),'sunday')-7;
        lEnddate   := lStartDate +6;

        if lCopyDate is not null then
        loop
            lStartDate := lStartdate + 7;
            lEndDate := lEnddate +7;

            exit when lStartDate >= lCopyDate;

            begin
                select id into lAid
                from workeravailability
                where resource_id = data.resource_id
                and lStartDate between
                startdate and enddate;
            exception
                when no_data_found then
                    lAid :=null;
            end;

            if lAid is null then
                lRetValue := AvailabilityAPI.SaveAvailability
                            (
                                iResourceID                 => data.resource_id,
                                iStartdate                  => lStartDate,
                                iEnddate                    => lEnddate,
                                iAvailabilityString         => data.availstr,
                                iAvailabilityID             => lAid,
                                iUserId                     => 1
                            );
            end if;
        end loop;
        end if;
   end loop;
   commit;
end;
